import Layout from '../components/MyLayout';
import Link from 'next/link';

const PostLink = props => (
  <li>
    <Link href={`/post?title=${props.title}`}></Link>
  </li>
)

export default function Index() {
  return (
      <Layout>
        <p>Hello Next.js</p>
      </Layout>
  );
}

